import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import './App.css';
import {Home} from './Home';
import {BucheteFlori} from './BucheteFlori';
import {AranjamenteFlori} from './AranjamenteFlori';
import {Nunta} from './Nunta';
import {Botez} from './Botez';
import {Contact} from './Contact';
import {NoMatch} from './NoMatch';
import {Layout} from './components/Layout';
import {NavigationBar} from './components/NavigationBar';
import {Jumbotron} from './components/Jumbotron';
import {BucheteDeMireasa} from './BucheteDeMireasa';
import {LumanariDeCununie} from './LumanariDeCununie';
import {AranjamenteFloraleMasa} from './AranjamenteFloraleMasa';
import {AranjamenteFloraleMasini} from './AranjamenteFloraleMasini';
import {BucheteDomnisoare} from './BucheteDomnisoare';

function App() {
  return (
    <React.Fragment>
      <NavigationBar />
      <Jumbotron />
      <Layout>
        <Router path="/">
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/bucheteflori" component={BucheteFlori} />
            <Route path="/aranjamenteflori" component={AranjamenteFlori} />
            <Route path="/nunta" component={Nunta} />
            <Route path="/buchetedemireasa" component={BucheteDeMireasa} />
            <Route path="/lumanaridecununie" component={LumanariDeCununie} />
            <Route path="/aranjamentefloralemasa" component={AranjamenteFloraleMasa} />
            <Route path="/aranjamentefloralemasini" component={AranjamenteFloraleMasini} />
            <Route path="/buchetedomnisoare" component={BucheteDomnisoare} />
            <Route path="/botez" component={Botez} />
            <Route path="/contact" component={Contact} />
            <Route component={NoMatch} />

          </Switch>
        </Router>
      </Layout>
    </React.Fragment>
  );
}

export default App;
